import React from 'react'
import { makeStyles } from '@material-ui/core/styles';
import { AppBar, IconButton, Toolbar } from '@material-ui/core';
import SortIcon from '@material-ui/icons/Sort';
import { useHistory } from 'react-router-dom';
import { Nav, Navbar, NavDropdown } from 'react-bootstrap'


function NavBar() {
    let history = useHistory();
    const useStyles = makeStyles((theme) => ({
        appbar: {
            // background: 'none',
            textAlign: 'left',
            background: 'rgba(0,0,0,0.08)',
            // display: 'block',
        },
        appbarTitle: {
            flexGrow: '2',
            color: 'white',
            underline: 'none',
            fontSize: '1.5rem',
            textDecoration: 'none' 
        },
        colorText: {
            color:'#FCC4D6',
        },
        title: {
            fontSize: '1rem'
        }

    }));
    const classes = useStyles()

    function handleClick() {
        history.push('/shop')
    }

    return (
        // <div>
        //     <AppBar className={classes.appbar} elevation={0}>
        //         <Toolbar className={classes.appbarWrapper} >
        //         <a href="/" className={classes.appbarTitle}>Jay's<span className={classes.colorText}>List</span></a>
        //         <a href="/shop">Products</a>
        //         <a href="/profile">Profile</a>
        //         </Toolbar>
        //     </AppBar>
        // </div>
        <div className={classes.appbar} >
            <Navbar sticky="top" expand="sm" collapseOnSelect>
                <a href="/" className={classes.appbarTitle}>Jay's<span className={classes.colorText}>List</span></a>
                <Nav>
                    <Nav.Link href="/">Home</Nav.Link>   
                    <Nav.Link href="/shop">Products</Nav.Link>
                    <Nav.Link href="/cart">Cart</Nav.Link>
                    <Nav.Link href="/log-in">Login</Nav.Link>
                </Nav>

            </Navbar>
        </div>
    )
}

export default NavBar;
